// StartPage.js

import React from 'react';
import './StartPage.css'; // Import your CSS file for styling
import LoginPage from '../LoginPage/LoginPage';
import { useHistory } from "react-router-dom";
import { Link } from 'react-router-dom';

const StartPage = () => {
    const history = useHistory();

    const handleClick = () => {
      history.push("/LoginPage/LoginPage");
    }
  return (
    <div>
      <header>
        <img src="logo.png" alt="Logo" />
        <p>PB App</p>
      </header>

      <section className="side-by-side-sections">
        <div className="left-section">
        <h1>Personal Budget App</h1>
        <p>A personal-budget management app</p>
        <div className="button-container">
        <button onClick={handleClick} >Login</button>
        <Link to="/login">
              <button>Login 2</button>
            </Link>
            <button >Signup</button>
        </div>
        </div>
        <div className="right-section">
        <img src="sidepic.png" alt="Logo" />
        </div>
      </section>
    </div>
  );
}

export default StartPage;
